import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Dashboard.css'; 
import { socket } from './socket';
function Dashboard() {
    
//   const navigate = useNavigate();

//   const handleLogout = () => {
//     localStorage.removeItem('token');
//     navigate('/');
    
//   }
const navigate = useNavigate();

    const handleLogout = () => {
        socket.disconnect(); // <-- BU SATIRI EKLEYİN
        localStorage.removeItem('token');
        navigate('/');
    }
  return (
    <div className="home-page-wrapper">
        <header className="dashboard-header">
            <div className="header-content">
                <span>Yönetici Paneli</span>
                <button onClick={handleLogout} className="logout-button">
                    Çıkış Yap
                </button>
            </div>
        </header>
        
        <div className="animation-container">
            <div className="car car-1"></div>
            <div className="car car-2"></div>
            <div className="car car-3"></div>
            <div className="car car-4"></div>
        </div>

        <div className="content-container">
            <h1 className="main-title">
                🚗 BayramlarAuto Yönetim Paneli
            </h1>
            <p className="subtitle">
                Hoş geldiniz! Ne yapmak istersiniz?
            </p>
            <nav className="navigation-buttons">
                {/* Yollar artık yöneticiye özel */}
                <button onClick={() => navigate('/admin/vehicles')}>Araç Yönetimi</button>
                <button onClick={() => navigate('/admin/personnel')}>Personel Yönetimi</button>
                <button onClick={() => navigate('/admin/kredi')}>Kredi Hesaplama</button>
                <button onClick={() => navigate('/admin/piyasa')}>Piyasa Değeri</button>
                 <button onClick={() => navigate('/admin/messages')}>Gelen Mesajlar</button>
            </nav>
        </div>
    </div>
  );
}

export default Dashboard;
